onst u8, (frame_data.nWidth * frame_data.nHeight) as usize); let mat = core::Mat::new_rows_cols_with_data( frame_data.nHeight, frame_data.nWidth, data ).unwrap(); let vec = core::Vector::<i32>::new(); if imgcodecs::imwrite("right.png", &mat, &vec).unwrap() { println!("Image saved successfully."); } else { println!("Failed to save the image."); } } } Err(e) => eprintln!("Failed to capture image: {:?}", e), } gx.gx_send_command(device_handle, GX_FEATURE_ID::GX_COMMAND_ACQUISITION_STOP) .expect("Failed to send command"); // Close the device gx.gx_close_device(device_handle) .expect("Failed to close device"); println!("Device closed.") } else { println!( "Failed to open device with SN: {}", first_device_sn.trim_end_matches(char::from(0)) ); } } else { println!("Failed to retrieve device base info, status: {}", status); } } else { println!("No Devices found."); } gx.gx_close_lib().expect("Failed to close library"); println!("Library closed."); Ok(()) }
